import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header className="bg-blue-600 text-white p-4">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-2xl font-bold">AI Interview</Link>
        <nav>
          <ul className="flex space-x-4">
            <li><Link to="/" className="hover:text-blue-200">Home</Link></li>
            <li><Link to="/features" className="hover:text-blue-200">Features</Link></li>
            <li><Link to="/pricing" className="hover:text-blue-200">Pricing</Link></li>
            <li><Link to="/support" className="hover:text-blue-200">Support</Link></li>
            <li><Link to="/login" className="hover:text-blue-200">Login</Link></li>
            <li><Link to="/register" className="hover:text-blue-200">Register</Link></li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
